import React from 'react';

function Button(){
  return (
    <button type="submit">
    Search
    </button>
  )
}

function Input(props){
    return (
      <input
        type="text"
        onChange={props.onUpdateWord}
        value={props.word}
      />
    )
  }

 const Search = (props) => {
  return (
    <form onSubmit={this.handleSubmit}>
    <div>
      <Input type="text" onChange={this.handleChange} ref="word"/>
      <Button />
    </div>
    </form>
  );
}

export default Search;
